import styled from 'styled-components'

export const Container = styled.div`
  margin: 0;
  padding: 0;
  box-sizing: border-box;
  font-family: 'Poppins', sans-serif;
`

export const Navigation = styled.div` 
  body{ 
     display: flex;
     justify-content: center;


  }

`
